import React from "react";
import { Grid, Image, Icon } from "semantic-ui-react";

export default () => {
  return (
    <Grid divided="vertically">
      <Grid.Row columns={1}>
        <Grid.Column>
          <div className="message">
            <div className="message-title">Chat message</div>
            <ul className="message-list" style={{padding: '0 0 0px 5px'}}>
              <li className="message-item">
                <Image
                  style={{
                    border: "2px solid red",
                    width: "50px",
                    borderRadius: "50%",
                  }}
                  src="https://react.semantic-ui.com/images/avatar/small/rachel.png"
                />
                <div className="message-chat">
                  <div className="message-chat-username">Anna Doe <Icon name="circle red">Offline</Icon></div>
                  <span>We are having an unexpected large food order </span>
                </div>
              </li>
            </ul>
          </div>
        </Grid.Column>
      </Grid.Row>
    </Grid>
  );
};
